import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '../materialUiComps/Typography';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  img: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  photos: {
    justifyContent: 'center',
  },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <React.Fragment>
    <br></br>
       <Typography variant="h3" marked="center" align="center" component="h2">
          Our Partnerships
      </Typography>
      <br></br>
      <Grid container className={classes.photos}>
          <img src="https://3.bp.blogspot.com/_-VxKllBZXP4/TR1CMAFj9tI/AAAAAAAAA_A/5bNOcaN5H54/s1600/10_GSUSA_servicemarkc.png"
           width="230" height="100"
          ></img>
          <img src="https://1000logos.net/wp-content/uploads/2018/04/United-Way-Logo.png"
           width="230" height="100"
           ></img>
          <img src="https://tano.org/wp-content/uploads/2014/12/Habitat-logo-transparent-color.png"
          width="230" height="100"
          ></img>
      </Grid>
    </React.Fragment>
  );
}

